import React, { Component } from 'react';
import { useNavigate } from "react-router-dom";
import './landing/landing.css'

const Landing = (props) => {
  const navigate = useNavigate();
 
  return (
    <>
     <div className='container'>
     
      <span className='text'><strong>We TRAIN and, build relationships with upcoming developers</strong> be a part of our community of developers.</span>

      <div className='b'>
        <button className='btn1' onClick={() => navigate("/Dop")}>WHY DOP@E?!</button>
        <button className='btn2' onClick={() => navigate("/Form")}>APPLY NOW!</button>
      </div>
    
    </div>
    </>
   
  );
};
 
export default Landing;
